import React from 'react'

import AvailableMeals from './AvailableMeals'

const Meals = (props) => {
  return (
    <React.Fragment>
      <AvailableMeals cartIsShown={props.cartIsShown} onClose={props.onClose} />
    </React.Fragment>
  )
}

export default Meals
